I'm glad to help you with that! Here's a simple example of how you can read the temperature from a Dallas 18B20 sensor using an ESP32 and display the temperature and sensor address on the Serial Monitor.

Please note that you'll need the OneWire and DallasTemperature libraries installed in your Arduino IDE. You can install them via the Library Manager.

```cpp
#include <OneWire.h>
#include <DallasTemperature.h>

#define ONE_WIRE_BUS D2 // Replace with the GPIO pin connected to the Dallas 18B20 sensor

OneWire oneWire(ONE_WIRE_BUS);
DallasTemperature sensors(&oneWire);

DeviceAddress sensorAddress1 = {0x28, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00}; // Replace with the sensor's unique address

void setup() {
  Serial.begin(115200);
  sensors.begin();
}

void loop() {
  sensors.requestTemperatures();
  float temperature = sensors.getTempCByIndex(0); // Get the temperature from the first sensor (index 0)

  Serial.print("Sensor Address: ");
  Serial.print(sensorAddress1[0], HEX);
  Serial.print(":");
  Serial.print(sensorAddress1[1], HEX);
  Serial.print(":");
  Serial.print(sensorAddress1[2], HEX);
  Serial.print(":");
  Serial.print(sensorAddress1[3], HEX);
  Serial.print(":");
  Serial.print(sensorAddress1[4], HEX);
  Serial.print(":");
  Serial.print(sensorAddress1[5], HEX);
  Serial.print(":");
  Serial.print(sensorAddress1[6], HEX);
  Serial.print(":");
  Serial.println(sensorAddress1[7], HEX);

  Serial.print("Temperature: ");
  Serial.println(temperature);

  delay(1000);
}
```

This code will print the sensor address and temperature on the Serial Monitor every second. Make sure to replace the sensor's unique address in the `sensorAddress1` variable with the actual address of your sensor.

Remember to save the sketch and upload it to your ESP32 board. After that, open the Serial Monitor in the Arduino IDE and you should see the temperature and sensor address being printed.

