Here is a simple JavaScript function that checks if a number is prime and prints it to the console if it is prime. The function uses a loop to check if the number has any factors other than 1 and itself.

```javascript
function checkPrime(arr) {
    for (let i = 0; i < arr.length; i++) {
        let num = arr[i];
        if (num > 1) {
            for (let j = 2; j <= Math.sqrt(num); j++) {
                if (num % j === 0) {
                    break;
                }
                if (j === Math.sqrt(num)) {
                    console.log(num, "is a prime number");
                }
            }
        }
    }
}

// Usage:
let numbers = [17, 2, 3, 13, 19];
checkPrime(numbers);
```

This function will print "17 is a prime number" because 17 is a prime number. It will not print anything for 2, 3, 13, and 19 because they are also prime numbers. It will not print anything for non-prime numbers in the array.

To create a `for` loop in Java, you can use the following syntax:

```java
for (initialization; condition; increment/decrement) {
    // code to be executed
}
```

Here's a simple example:

```java
for (int i = 0; i < 10; i++) {
    System.out.println(i);
}
```

In this example, `initialization` is where you initialize your counter variable (in this case, `i` is initialized to 0), `condition` is the condition that the loop will continue to run as long as it's true (in this case, `i` is less than 10), and `increment/decrement` is where you update your counter variable (in this case, `i` is incremented by 1 on each iteration). The code within the loop will be executed on each iteration.
